impl Solution {
    pub fn min_operations(nums1: Vec<i32>, nums2: Vec<i32>) -> i32 {
        let n = nums1.len();
        let mut diff_pairs = Vec::new();

        // Calculate the difference and check if swapping is needed
        for i in 0..n {
            diff_pairs.push((nums1[i] - nums2[i]).abs());
        }

        let mut max1 = nums1[n - 1];
        let mut max2 = nums2[n - 1];
        let mut operations = 0;

        for i in (0..n - 1).rev() {
            if nums1[i] > max1 {
                if nums2[i] < nums1[i] && nums2[i] > max2 {
                    max1 = nums2[i];
                    max2 = nums1[i];
                    operations += 1;
                } else {
                    max1 = nums1[i];
                }
            } else if nums2[i] > max2 {
                if nums1[i] < nums2[i] && nums1[i] > max1 {
                    max2 = nums1[i];
                    max1 = nums2[i];
                    operations += 1;
                } else {
                    max2 = nums2[i];
                }
            }
        }

        if max1 == nums1[n - 1] && max2 == nums2[n - 1] {
            operations
        } else {
            -1
        }
    }
}
